td,
th {
	border: 1px solid rgba(151, 151, 151, 0.48) !important;
	padding: 20px 15px !important;
}

table {
	position: relative;
	border-collapse: collapse !important;
}

tbody {
	overflow: auto;
	border: none !important;
}
.table-responsive {
	overflow: auto;
	max-height: calc(57.5px + calc(55.5px * 10));
	border: 1px solid black !important;
}
.table-responsive thead {
	position: sticky;
	top: 0;
	z-index: 1;
	background-color: #fff;
	border: none !important;
	margin-bottom: 1px !important;
	box-shadow: -1px 1px 0 1px #000 !important;
}
thead th {
	border: none !important;
	border-left: 1px solid rgba(151, 151, 151, 0.48) !important;
}
